import React from 'react'
import styled from 'styled-components'
import {useState,useEffect,useContext} from 'react'
import {Context} from '../Context'
import {TiGroupOutline} from 'react-icons/ti'
function Last() {

const {user} = useContext(Context)
const {myrooms} = useContext(Context)



useEffect(() => {

  console.table(myrooms)


},[])







  return (
    <div>
      <h3 style = {{color : "white",padding : "20px"}}>My rooms : </h3>

      {
        myrooms.map(e => { 
          return(
            <div>
              <Messagediv>
                <TiGroupOutline style = {{color : "white",fontSize : "40px",textAlign : "center",marginTop : "7px",marginLeft : "10px"}}/>
                <span >

                  <span style = {{marginLeft : "20px",color : "white",marginBottom : "10px"}}>{e.roomname}</span>
                  <span style = {{float : "right",marginRight : "40px",color : "white"}}>{e.inroom.length}</span>

                  </span>

                  <p >

                  <span style = {{marginLeft : "20px",color : "white",marginBottom : "10px"}}>{e.user}</span>

                  </p>






              </Messagediv>
            </div>
          )
        })
      }

















    </div>
  )
}

export default Last

const Messagediv = styled.div`
width : 100%;
height : 80px;
border : solid 1px green;
`
